import React from 'react';
import { Route, Routes } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import Navbar from './components/Navbar';
import RegisterForm from './components/RegisterForm';


function App() {
  return (
    <React.Fragment  >
      <Navbar></Navbar>
      <main>
      <Routes>
        <Route path='/' exact>

        </Route>
        <Route path='/login'>
          <LoginForm/>
        </Route>
        <Route path='/register'>
          <RegisterForm/>
        </Route>
      </Routes>
      </main>

    </React.Fragment>
  );
}

export default App;
